const TableData = () => {
   
    let users;
    
    useEffect(() => {
        
        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')

                const [user,setUser]= useState();
                setUser(data);
            })
    }, []);

    return (

        <>
            <h1>{user}</h1>
        </>
    );
};

export default TableData;
